action was initiated by the itl.';
comment on column "itl_reconciliation_log"."recon_action_end_datetime" is 'Date and time a reconciliation
action was concluded by the itl.';
comment on column "itl_reconciliation_log"."recon_phase_code" is 'Unique identifier for a reconciliation
start phase.';
comment on table "itl_reconciliation_log" is 'contains information about each reconciliation action
initiated by the itl, including date and time and comments.';

